            if (!$entity->{'tipo_residuo'}) {
                $tipo_residuo = $em->getRepository("ModelBundle:TipoResiduo")->findOneByNombre($entity->{'nombre'});
                if (!$tipo_residuo) {
                    $tipo_residuo = new TipoResiduo();
                }
                $tipo_residuo->setCodigo($entity->{'grupo'});
                $tipo_residuo->setNombre($entity->{'nombre'});
                $tipo_residuo->setColor($entity->{'color'});
                $tipo_residuo->setUsaContenedor($entity->{'contenedor'});
                $tipo_residuo->setUsaVolqueta($entity->{'volqueta'});

                if ($entity->{'nombre'} == "Orgánicos") {
                    $tipo_residuo->setValidarDisposicion(0);
                } else {
                    $tipo_residuo->setValidarDisposicion(1);
                }
                if ($entity->{'nombre'} == "No reciclables") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Ordinario');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(false);
                }
                if ($entity->{'nombre'} == "Reciclables") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Reciclable');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(true);
                }
                if ($entity->{'nombre'} == "Orgánicos") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Orgánico');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(false);
                }
                if ($entity->{'nombre'} == "Peligrosos") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Peligroso');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(false);
                }
                if ($entity->{'nombre'} == "Riesgo biológico") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Peligroso');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(false);
                }
                if ($entity->{'nombre'} == "Eléctrico") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Electronico');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(true);
                }
                if ($entity->{'nombre'} == "RCD") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('RCD');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(true);
                }
                if ($entity->{'nombre'} == "Especiales") {
                    $disposicion = $em->getRepository("ModelBundle:Disposicion")->findOneByNombre('Especiales');
                    $tipo_residuo->setDisposicion($disposicion);
                    $tipo_residuo->setReciclabe(false);
                }

                $this->addReference('residuo_' . $entity->{'nombre'}, $tipo_residuo);

                $manager->persist($tipo_residuo);
            } else {
                $tp_residuo = $this->getReference('residuo_' . $entity->{'tipo_residuo'});
                $residuo = $em->getRepository("ModelBundle:Residuo")->findOneBy(array('nombre' => $entity->{'nombre'}, 'tipo_residuo' => $tp_residuo));
                if (!$residuo) {
                    $residuo = new Residuo();
                }
                $codigo = $entity->{'subclase'};
                if(!$codigo){
                    $codigo = $entity->{'grupo'};
                }
                $residuo->setCodigo($codigo);
                $residuo->setNombre($entity->{'nombre'});
                $residuo->setTipoResiduo($tp_residuo);
                $residuo->setDensidad($entity->{'densidad'});
                $manager->persist($residuo);
            }
